import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
import Sdata from "./Sdata";
// console.log(Sdata[0]);

function ncard(val, ind, arr) {
  console.log(val);
  return (
    <Card
      imgSrc={val.imgSrc}
      sname={val.sname}
      title={val.title}
      links={val.links}
    />
  );
}

ReactDOM.render(
  <>
    <h1>List of Series</h1>

    {Sdata.map(function ncard(val) {
      return (
        <Card
          imgSrc={val.imgSrc}
          sname={val.sname}
          title={val.title}
          links={val.links}
        />
      );
    })}
  </>,
  document.getElementById("root")
);
